const LevelCard = (props) => {
    return (
        <div className="w-44 h-16 mx-1 bg-gray-800 rounded-md">
            <div className="flex items-center">
                <h1 className="text-center text-white">{props.name}</h1>
            </div>
        </div>
    );
}

export default LevelCard;
